func convertABI(abiStr string) *abi.ABI {
	result, _ := abi.New([]byte(abiStr))
	return result
}

func convertBytecode(hexStr string) []byte {
	s, _ := hex.DecodeString(strings.ReplaceAll(hexStr, "0x", ""))
	return s
}
